import React from 'react';

function EliminarRegistro() {
    return (
        <div>
            <h1>Eliminar Registro</h1>
            <form>
                <input type="text" placeholder="ID del Registro" required />
                <button type="submit">Eliminar</button>
            </form>
        </div>
    );
    
}

export default EliminarRegistro;
